import "./App.css";
import { Button, FormGroup, TextField, Typography } from "@mui/material";
import React, { useState, useEffect } from 'react';

function App() {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [isbnInput, setIsbnInput] = useState("");

  useEffect(() => {
    fetch(
      `https://openlibrary.org/api/books?bibkeys=ISBN:${isbnInput}&jscmd=details&format=json`
    )
      .then((res) => res.json())
      .then(
        (result) => {
          setIsLoaded(true);
          setIsbnInput(result);
        },

        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          setIsLoaded(true);
          setError(error);
          console.log(error);
        }
      );
  }, []);

  function handleSubmit(event) {
    event.preventDefault();
    console.log( 'ISBN:', isbnInput); 
   // You should see email and password in console.
   // ..code to submit form to backend here...
}
  return (
    <div className="App">
      <header className="App-header">
        <Typography variant="h1">Book Finder</Typography>
        <FormGroup onSubmit={handleSubmit} >
        <TextField
          sx={{ backgroundColor: "white" }}
          value={JSON.stringify(isbnInput)}
          onChange={(event) => {
            setIsbnInput(event.target.value);
          }}
        />
        <Typography>{JSON.stringify(isbnInput)}</Typography>
        <Button type="submit">
                        Submit
         </Button>
         </FormGroup>
      </header>
    </div>
  );
}

export default App;
